    t[283] = "\u0391\u03b9\u03c3\u03b8\u03b7\u03c4\u03b9\u03ba\u03bf\u03c0\u03bf\u03af\u03b7\u03c3\u03b7 \u03b3\u03b9\u03b1 Multihoming";
    t[288] = "Local destination";
    t[289] = "\u03a4\u03bf\u03c0\u03b9\u03ba\u03cc\u03c2 \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03cc\u03c2";
    t[292] = "Reduced tunnel count";
    t[293] = "\u039c\u03b5\u03b9\u03c9\u03bc\u03ad\u03bd\u03bf\u03c2 \u03b1\u03c1\u03b9\u03b8\u03bc\u03cc\u03c2 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03c9\u03bd";
    t[300] = "+ 0-2 hop variance";
    t[301] = "+ 0-2 \u03b4\u03b9\u03b1\u03ba\u03cd\u03bc\u03b1\u03bd\u03c3\u03b7 \u03ba\u03bb\u03af\u03c3\u03bc\u03b1\u03c4\u03bf\u03c2";
    t[302] = "Alt Base32";
    t[303] = "\u0395\u03bd\u03b1\u03bb\u03bb\u03b1\u03ba\u03c4\u03b9\u03ba\u03cc Base32";
    t[304] = "Port";
    t[305] = "\u039b\u03b9\u03bc\u03ac\u03bd\u03b9";
    t[318] = "Per Day";
    t[319] = "\u0391\u03bd\u03ac \u0397\u03bc\u03ad\u03c1\u03b1";
    t[326] = "IRC networks outside I2P can also be reached if a SOCKS outproxy within I2P is known, though it depends on whether or not the outproxy has been blocked by the IRC network.";
    t[327] = "\u03a4\u03b1 IRC \u03b4\u03af\u03ba\u03c4\u03c5\u03b1 \u03b5\u03ba\u03c4\u03cc\u03c2 I2P \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03bd \u03b5\u03c0\u03af\u03c3\u03b7\u03c2 \u03bd\u03b1 \u03c0\u03c1\u03bf\u03c3\u03c7\u03c9\u03c1\u03ae\u03c3\u03bf\u03c5\u03bd \u03b1\u03bd \u03b3\u03bd\u03c9\u03c1\u03af\u03b6\u03b5\u03c4\u03b5 \u03ad\u03bd\u03b1 SOCKS outproxy \u03bc\u03ad\u03c3\u03b1 \u03c3\u03c4\u03bf I2P, \u03b1\u03bd \u03ba\u03b1\u03b9 \u03b5\u03be\u03b1\u03c1\u03c4\u03ac\u03c4\u03b1\u03b9 \u03b1\u03c0\u03cc \u03c4\u03bf \u03b5\u03ac\u03bd \u03b7 outproxy \u03ad\u03c7\u03b5\u03b9 \u03b1\u03c0\u03bf\u03ba\u03bb\u03b5\u03b9\u03c3\u03c4\u03b5\u03af \u03b1\u03c0\u03cc \u03c4\u03bf IRC \u03b4\u03af\u03ba\u03c4\u03c5\u03bf \u03ae \u03cc\u03c7\u03b9.";
    t[330] = "Specify the .i2p address or destination (b32 or b64) of the tunnel here.";
    t[331] = "\u0394\u03b9\u03b1\u03b8\u03ad\u03c3\u03c4\u03b5 \u03c4\u03b7 \u03b4\u03b9\u03b5\u03cd\u03b8\u03c5\u03bd\u03c3\u03b7 .i2p \u03ae \u03c4\u03bf\u03bd \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03cc (b32 \u03ae b64) \u03c4\u03bf\u03c5 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 \u03b5\u03b4\u03ce.";
    t[332] = "Invalid address";
    t[333] = "\u039c\u03b7 \u03ad\u03b3\u03ba\u03c5\u03c1\u03b7 \u03b4\u03b9\u03b5\u03cd\u03b8\u03c5\u03bd\u03c3\u03b7";
    t[334] = "This tunnel must be configured with the new subdomain and destination.";
    t[335] = "\u0391\u03c5\u03c4\u03cc\u03c2 \u03bf \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c1\u03c5\u03b8\u03bc\u03b9\u03c3\u03bc\u03ad\u03bd\u03bf\u03c2 \u03bc\u03b5 \u03c4\u03bf\u03bd \u03bd\u03ad\u03bf \u03c5\u03c0\u03bf\u03c4\u03bf\u03bc\u03ad\u03b1 \u03ba\u03b1\u03b9 \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03cc.";
    t[342] = "Close tunnels when idle";
    t[343] = "\u039a\u03bb\u03b5\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf\u03c5\u03c2 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5\u03c2 \u03cc\u03c4\u03b1\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03ac\u03c1\u03b1\u03b4\u03bd\u03bf\u03b9";
    t[346] = "Next";
    t[347] = "\u0395\u03c0\u03cc\u03bc\u03b5\u03bd\u03bf";
    t[348] = "The first thing to decide is whether you want to create a server or a client tunnel.";
    t[349] = "\u03a4\u03bf \u03c0\u03c1\u03ce\u03c4\u03bf \u03c0\u03c1\u03ac\u03b3\u03bc\u03b1 \u03c0\u03bf\u03c5 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b1\u03c0\u03bf\u03c6\u03b1\u03c3\u03af\u03c3\u03b5\u03c4\u03b5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03bd \u03b8\u03ad\u03bb\u03b5\u03c4\u03b5 \u03bd\u03b1 \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03ae\u03c3\u03b5\u03c4\u03b5 \u03ad\u03bd\u03b1\u03bd \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae \u03ae \u03ad\u03bd\u03b1\u03bd \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7.";
    t[350] = "Set the Referrer-Policy header to 'same-origin' for html, xml, json and text files";
    t[351] = "\u03a1\u03c5\u03b8\u03bc\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf header Referrer-Policy \u03c3\u03b5 'same-origin' \u03b3\u03b9\u03b1 \u03c4\u03b1 \u03b1\u03c1\u03c7\u03b5\u03af\u03b1 html, xml, json \u03ba\u03b1\u03b9 text";
    t[352] = "Inbound";
    t[353] = "\u0395\u03b9\u03c3\u03b5\u03c1\u03c7\u03cc\u03bc\u03b5\u03bd\u03bf\u03c2";
    t[358] = "Per Minute";
    t[359] = "\u0391\u03bd\u03ac \u039b\u03b5\u03c0\u03c4\u03cc";
    t[360] = "Port not set";
    t[361] = "\u039b\u03b9\u03bc\u03ac\u03bd\u03b9 \u03b4\u03b5\u03bd \u03ad\u03c7\u03b5\u03b9 \u03bf\u03c1\u03b9\u03c3\u03c4\u03b5\u03af";
    t[368] = "Unique Local Address per Client";
    t[369] = "\u039c\u03bf\u03bd\u03b1\u03b4\u03b9\u03ba\u03ae \u03a4\u03bf\u03c0\u03b9\u03ba\u03ae \u0394\u03b9\u03b5\u03cd\u03b8\u03c5\u03bd\u03c3\u03b7 \u03b3\u03b9\u03b1 \u03ba\u03ac\u03b8\u03b5 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7";
    t[374] = "Return to Tunnel Configuration";
    t[375] = "\u0395\u03c0\u03b9\u03c3\u03c4\u03c1\u03bf\u03c6\u03ae \u03c3\u03c4\u03b7 \u0394\u03b9\u03b1\u03bc\u03cc\u03c1\u03c6\u03c9\u03c3\u03b7 \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[378] = "Blinded";
    t[379] = "Blinded";
    t[380] = "Enable SSL";
    t[381] = "\u0395\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03af\u03b7\u03c3\u03b7 SSL";
    t[382] = "Traffic from all clients with this feature enabled will be routed over the same set of tunnels. This will make profiling the tunnels by an adversary more difficult, but will link the clients together.";
    t[383] = "\u039f \u03c1\u03bf\u03ad\u03c2 \u03b4\u03b5\u03b4\u03bf\u03bc\u03ad\u03bd\u03c9\u03bd \u03b1\u03c0\u03cc \u03cc\u03bb\u03bf\u03c5\u03c2 \u03c4\u03bf\u03c5\u03c2 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b5\u03c2 \u03bc\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7 \u03b4\u03c5\u03bd\u03b1\u03c4\u03cc\u03c4\u03b7\u03c4\u03b1 \u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03b7 \u03b8\u03b1 \u03b4\u03b9\u03b1\u03b4\u03c1\u03bf\u03bc\u03bf\u03bb\u03bf\u03b3\u03b7\u03b8\u03bf\u03cd\u03bd \u03bc\u03ad\u03c3\u03c9 \u03c4\u03bf\u03c5 \u03af\u03b4\u03b9\u03bf\u03c5 \u03c3\u03cd\u03bd\u03bf\u03bb\u03bf\u03c5 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03c9\u03bd. \u0391\u03c5\u03c4\u03cc \u03b8\u03b1 \u03ba\u03b1\u03c4\u03b1\u03c3\u03c4\u03ae\u03c3\u03b5\u03b9 \u03b4\u03c5\u03c3\u03ba\u03bf\u03bb\u03cc\u03c4\u03b5\u03c1\u03b7 \u03c4\u03b7\u03bd \u03c0\u03c1\u03bf\u03c3\u03c9\u03c0\u03bf\u03c0\u03bf\u03af\u03b7\u03c3\u03b7 \u03c4\u03c9\u03bd \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03c9\u03bd \u03b1\u03c0\u03cc \u03b5\u03c7\u03b8\u03c1\u03cc, \u03b1\u03bb\u03bb\u03ac \u03b8\u03b1 \u03c3\u03c5\u03bd\u03b4\u03ad\u03c3\u03b5\u03b9 \u03c4\u03bf\u03c5\u03c2 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b5\u03c2 \u03bc\u03b5\u03c4\u03b1\u03be\u03cd \u03c4\u03bf\u03c5\u03c2.";
    t[384] = "This means that only one I2P tunnel is required rather than a separate tunnel per IRC network.";
    t[385] = "\u0391\u03c5\u03c4\u03cc \u03c3\u03b7\u03bc\u03b1\u03af\u03bd\u03b5\u03b9 \u03cc\u03c4\u03b9 \u03b1\u03c0\u03b1\u03b9\u03c4\u03b5\u03af\u03c4\u03b1\u03b9 \u03bc\u03cc\u03bd\u03bf \u03ad\u03bd\u03b1\u03c2 \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 I2P, \u03b1\u03bd\u03c4\u03af \u03b3\u03b9\u03b1 \u03ad\u03bd\u03b1\u03bd \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf \u03b3\u03b9\u03b1 \u03ba\u03ac\u03b8\u03b5 IRC \u03b4\u03af\u03ba\u03c4\u03c5\u03bf.";
    t[386] = "higher bandwidth and reliability";
    t[387] = "\u03bc\u03b5\u03b3\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03b7 \u03c1\u03c5\u03b8\u03bc\u03b9\u03ba\u03cc\u03c4\u03b7\u03c4\u03b1 \u03ba\u03b1\u03b9 \u03b1\u03be\u03b9\u03bf\u03c0\u03b9\u03c3\u03c4\u03af\u03b1";
    t[392] = "Alternate local destination";
    t[393] = "\u0395\u03bd\u03b1\u03bb\u03bb\u03b1\u03ba\u03c4\u03b9\u03ba\u03cc \u03c4\u03bf\u03c0\u03b9\u03ba\u03cc \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03cc\u03c2";
    t[398] = "Test HTTP server through I2P";
    t[399] = "\u0394\u03bf\u03ba\u03b9\u03bc\u03ae HTTP \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae \u03bc\u03ad\u03c3\u03c9 I2P";
    t[408] = "Description";
    t[409] = "\u03a0\u03b5\u03c1\u03b9\u03b3\u03c1\u03b1\u03c6\u03ae";
    t[410] = "Private key file";
    t[411] = "\u0391\u03c1\u03c7\u03b5\u03af\u03bf \u03b9\u03b4\u03b9\u03c9\u03c4\u03b9\u03ba\u03ae\u03c2 \u03ba\u03bb\u03b5\u03b9\u03b4\u03b9\u03ac\u03c2";
    t[412] = "Listening interface (IP address) for client access (normally 127.0.0.1)";
    t[413] = "\u0395\u03c0\u03b9\u03c6\u03ac\u03bd\u03b5\u03b9\u03b1 \u03b1\u03ba\u03cc\u03bb\u03bf\u03c5\u03b8\u03b7\u03c2 \u03b1\u03bd\u03b1\u03bc\u03bf\u03bd\u03ae\u03c2 (\u03b4\u03b9\u03b5\u03cd\u03b8\u03c5\u03bd\u03c3\u03b7 IP) \u03b3\u03b9\u03b1 \u03c0\u03c1\u03cc\u03c3\u03b2\u03b1\u03c3\u03b7 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7 (\u03c3\u03c5\u03bd\u03ae\u03b8\u03c9\u03c2 127.0.0.1)";
    t[422] = "Server or client tunnel?";
    t[423] = "\u0394\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae\u03c2 \u03ae \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7?";
    t[426] = "out";
    t[427] = "\u03b5\u03ba\u03c4\u03cc\u03c2";
    t[432] = "Tunnel type";
    t[433] = "\u03a4\u03cd\u03c0\u03bf\u03c2 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[434] = "Absolute path to file containing filter definition";
    t[435] = "\u0391\u03c0\u03cc\u03bb\u03c5\u03c4\u03b7 \u03b4\u03b9\u03b5\u03cd\u03b8\u03c5\u03bd\u03c3\u03b7 \u03c4\u03bf\u03c5 \u03b1\u03c1\u03c7\u03b5\u03af\u03bf\u03c5 \u03c0\u03bf\u03c5 \u03c0\u03b5\u03c1\u03b9\u03ad\u03c7\u03b5\u03b9 \u03c4\u03b7\u03bd \u03bf\u03c1\u03b9\u03c3\u03bc\u03cc \u03c6\u03af\u03bb\u03c4\u03c1\u03bf\u03c5";
    t[436] = "Authentication for adding alias";
    t[437] = "\u0391\u03c5\u03b8\u03b5\u03bd\u03c4\u03b9\u03ba\u03bf\u03c0\u03bf\u03af\u03b7\u03c3\u03b7 \u03b3\u03b9\u03b1 \u03c4\u03b7\u03bd \u03c0\u03c1\u03bf\u03c3\u03b8\u03ae\u03ba\u03b7 \u03b5\u03bd\u03b1\u03bb\u03bb\u03b1\u03ba\u03c4\u03b9\u03ba\u03bf\u03cd \u03cc\u03bd\u03bf\u03bc\u03b1\u03c4\u03bf\u03c2";
    t[444] = "Specify filename or full path for new key";
    t[445] = "\u039f\u03c1\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf \u03cc\u03bd\u03bf\u03bc\u03b1 \u03b1\u03c1\u03c7\u03b5\u03af\u03bf\u03c5 \u03ae \u03c4\u03b7\u03bd \u03c0\u03bb\u03ae\u03c1\u03b7 \u03b4\u03b9\u03b5\u03cd\u03b8\u03c5\u03bd\u03c3\u03b7 \u03b3\u03b9\u03b1 \u03c4\u03bf \u03bd\u03ad\u03bf \u03ba\u03bb\u03b5\u03b9\u03b4\u03af";
    t[448] = "Close Tunnel Idle Time";
    t[449] = "\u039a\u03bb\u03b5\u03af\u03c3\u03b9\u03bc\u03bf \u0386\u03c1\u03b1\u03b4\u03bd\u03b7\u03c2 \u03a7\u03c1\u03bf\u03bd\u03b9\u03ba\u03ae\u03c2 \u0394\u03b9\u03ac\u03c1\u03ba\u03b5\u03b9\u03b1\u03c2 \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[454] = "Usually, a separate tunnel needs to be created for each IRC server that is to be accessible inside I2P.";
    t[455] = "\u03a3\u03c5\u03bd\u03ae\u03b8\u03c9\u03c2, \u03c7\u03c1\u03b5\u03b9\u03ac\u03b6\u03b5\u03c4\u03b1\u03b9 \u03bd\u03b1 \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03b7\u03b8\u03b5\u03af \u03ad\u03bd\u03b1\u03c2 \u03be\u03b5\u03c7\u03c9\u03c1\u03b9\u03c3\u03c4\u03cc\u03c2 \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03b3\u03b9\u03b1 \u03ba\u03ac\u03b8\u03b5 IRC \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae \u03c0\u03bf\u03c5 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c0\u03c1\u03bf\u03c3\u03b2\u03ac\u03c3\u03b9\u03bc\u03bf\u03c2 \u03bc\u03ad\u03c3\u03b1 \u03c3\u03c4\u03bf I2P.";
    t[456] = "Password (required to encrypt the certificate)";
    t[457] = "\u039a\u03c9\u03b4\u03b9\u03ba\u03cc\u03c2 (\u03c7\u03c1\u03b5\u03b9\u03ac\u03b6\u03b5\u03c4\u03b1\u03b9 \u03b3\u03b9\u03b1 \u03c4\u03b7\u03bd \u03ba\u03c1\u03c5\u03c0\u03c4\u03bf\u03b3\u03c1\u03ac\u03c6\u03b7\u03c3\u03b7 \u03c4\u03bf\u03c5 \u03c0\u03b9\u03c3\u03c4\u03bf\u03c0\u03bf\u03b9\u03b7\u03c4\u03b9\u03ba\u03bf\u03cd)";
    t[458] = "HTTP Filtering";
    t[459] = "\u03a6\u03af\u03bb\u03c4\u03c1\u03bf HTTP";
    t[462] = "internal plugin";
    t[463] = "\u03b5\u03c3\u03c9\u03c4\u03b5\u03c1\u03b9\u03ba\u03cc plugin";
    t[468] = "Disable";
    t[469] = "\u0391\u03c0\u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03af\u03b7\u03c3\u03b7";
    t[472] = "Access Point";
    t[473] = "\u03a3\u03b7\u03bc\u03b5\u03af\u03bf \u03a0\u03c1\u03cc\u03c3\u03b2\u03b1\u03c3\u03b7\u03c2";
    t[476] = "Specify the local port this service should be accessible from";
    t[477] = "\u0394\u03b9\u03b1\u03b8\u03ad\u03c3\u03c4\u03b5 \u03c4\u03bf \u03c4\u03bf\u03c0\u03b9\u03ba\u03cc \u03bb\u03b9\u03bc\u03ac\u03bd\u03b9 \u03b1\u03c0\u03cc \u03c4\u03bf \u03bf\u03c0\u03bf\u03af\u03bf \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c0\u03c1\u03bf\u03c3\u03b2\u03ac\u03c3\u03b9\u03bc\u03b7 \u03b7 \u03c5\u03c0\u03b7\u03c1\u03b5\u03c3\u03af\u03b1 \u03b1\u03c5\u03c4\u03ae";
    t[506] = "very high randomization, very low performance";
    t[507] = "\u03c0\u03bf\u03bb\u03cd \u03c5\u03c8\u03b7\u03bb\u03ae \u03c3\u03c5\u03bd\u03c4\u03c5\u03c7\u03b1\u03b9\u03cc\u03c4\u03b7\u03c4\u03b1, \u03c0\u03bf\u03bb\u03cd \u03c7\u03b1\u03bc\u03b7\u03bb\u03ae \u03b1\u03c0\u03cc\u03b4\u03bf\u03c3\u03b7";
    t[514] = "Server";
    t[515] = "\u0394\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae\u03c2";
    t[522] = "Preview";
    t[523] = "\u03a0\u03c1\u03bf\u03b5\u03c0\u03b9\u03c3\u03ba\u03cc\u03c0\u03b7\u03c3\u03b7";
    t[526] = "You can do this by clicking the Start button on the main page which corresponds to the new tunnel.";
    t[527] = "\u039c\u03c0\u03bf\u03c1\u03b5\u03af\u03c4\u03b5 \u03bd\u03b1 \u03c4\u03bf \u03ba\u03ac\u03bd\u03b5\u03c4\u03b5 \u03b1\u03c5\u03c4\u03cc \u03ba\u03ac\u03bd\u03bf\u03bd\u03c4\u03b1\u03c2 \u03ba\u03bb\u03b9\u03ba \u03c3\u03c4\u03bf \u03ba\u03bf\u03c5\u03bc\u03c0\u03af \u0388\u03bd\u03b1\u03c1\u03be\u03b7\u03c2 \u03c4\u03b7\u03c2 \u03ba\u03cd\u03c1\u03b9\u03b1\u03c2 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1\u03c2 \u03c0\u03bf\u03c5 \u03b1\u03bd\u03c4\u03b9\u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af \u03c3\u03c4\u03bf\u03bd \u03bd\u03ad\u03bf \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf.";
    t[530] = "Tunnel auto-start";
    t[531] = "\u0391\u03c5\u03c4\u03cc\u03bc\u03b1\u03c4\u03b7 \u03ad\u03bd\u03b1\u03c1\u03be\u03b7 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[534] = "Binding address";
