    t[1129] = "\u0395\u03c0\u03b5\u03be\u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1 \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 \u0394\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae";
    t[1130] = "SOCKS 4/4a/5 proxy";
    t[1131] = "Proxy SOCKS 4/4a/5";
    t[1134] = "Set the Allow header to 'GET, POST, HEAD' for html, xml, json and text files";
    t[1135] = "\u03a1\u03c5\u03b8\u03bc\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf header Allow \u03c3\u03b5 'GET, POST, HEAD' \u03b3\u03b9\u03b1 \u03c4\u03b1 \u03b1\u03c1\u03c7\u03b5\u03af\u03b1 html, xml, json \u03ba\u03b1\u03b9 text";
    t[1136] = "Client";
    t[1137] = "\u03a0\u03b5\u03bb\u03ac\u03c4\u03b7\u03c2";
    t[1138] = "The wizard has now collected enough information to create your tunnel.";
    t[1139] = "\u039f \u03c6\u03bf\u03b9\u03c4\u03b7\u03c4\u03ae\u03c2 \u03ad\u03c7\u03b5\u03b9 \u03c3\u03c5\u03bb\u03bb\u03ad\u03be\u03b5\u03b9 \u03c4\u03ce\u03c1\u03b1 \u03b1\u03c1\u03ba\u03b5\u03c4\u03ad\u03c2 \u03c0\u03bb\u03b7\u03c1\u03bf\u03c6\u03bf\u03c1\u03af\u03b5\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03ae\u03c3\u03b5\u03b9 \u03c4\u03bf\u03bd \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf \u03c3\u03b1\u03c2.";
    t[1144] = "New Client Configuration";
    t[1145] = "\u039d\u03ad\u03b1 \u0394\u03b9\u03b1\u03bc\u03cc\u03c1\u03c6\u03c9\u03c3\u03b7 \u03a0\u03b5\u03bb\u03ac\u03c4\u03b7";
    t[1156] = "Deny User-Agents matching these strings (probably from inproxies)";
    t[1157] = "\u0391\u03c0\u03bf\u03c1\u03c1\u03af\u03c8\u03c4\u03b5 \u03c4\u03bf\u03c5\u03c2 User-Agents \u03c0\u03bf\u03c5 \u03c4\u03b1\u03b9\u03c1\u03b9\u03ac\u03b6\u03bf\u03c5\u03bd \u03c3\u03b5 \u03b1\u03c5\u03c4\u03ad\u03c2 \u03c4\u03b9\u03c2 \u03c3\u03b5\u03b9\u03c1\u03ad\u03c2 (\u03c0\u03b9\u03b8\u03b1\u03bd\u03ce\u03c2 \u03b1\u03c0\u03cc inproxies)";
    t[1158] = "Basic tunnel for connecting to a single service inside I2P.";
    t[1159] = "\u0392\u03b1\u03c3\u03b9\u03ba\u03cc\u03c2 \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03b7 \u03c3\u03cd\u03bd\u03b4\u03b5\u03c3\u03b7 \u03c3\u03b5 \u03ad\u03bd\u03b1 \u03bc\u03bf\u03bd\u03b1\u03b4\u03b9\u03ba\u03cc \u03c5\u03c0\u03b7\u03c1\u03b5\u03c3\u03af\u03b1 \u03bc\u03ad\u03c3\u03b1 \u03c3\u03c4\u03bf I2P.";
    t[1160] = "Restricted Access List";
    t[1161] = "\u039b\u03af\u03c3\u03c4\u03b1 \u039f\u03c1\u03b9\u03c3\u03bc\u03ad\u03bd\u03b7\u03c2 \u03a0\u03c1\u03cc\u03c3\u03b2\u03b1\u03c3\u03b7\u03c2";
    t[1162] = "Generate new SSL certificate";
    t[1163] = "\u0394\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03af\u03b1 \u03bd\u03ad\u03bf\u03c5 \u03c0\u03b9\u03c3\u03c4\u03bf\u03c0\u03bf\u03b9\u03b7\u03c4\u03b9\u03ba\u03bf\u03cd SSL";
    t[1172] = "Alongside these basic settings, there are a number of advanced options for tunnel configuration.";
    t[1173] = "\u03a0\u03b1\u03c1\u03ac\u03bb\u03bb\u03b7\u03bb\u03b1 \u03bc\u03b5 \u03b1\u03c5\u03c4\u03ad\u03c2 \u03c4\u03b9\u03c2 \u03b2\u03b1\u03c3\u03b9\u03ba\u03ad\u03c2 \u03c1\u03c5\u03b8\u03bc\u03af\u03c3\u03b5\u03b9\u03c2, \u03c5\u03c0\u03ac\u03c1\u03c7\u03bf\u03c5\u03bd \u03c0\u03bf\u03bb\u03bb\u03ad\u03c2 \u03c0\u03c1\u03bf\u03c7\u03c9\u03c1\u03b7\u03bc\u03ad\u03bd\u03b5\u03c2 \u03b5\u03c0\u03b9\u03bb\u03bf\u03b3\u03ad\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03b7 \u03b4\u03b9\u03b1\u03bc\u03cc\u03c1\u03c6\u03c9\u03c3\u03b7 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5.";
    t[1184] = "This is the port that the client tunnel will be accessed from locally.";
    t[1185] = "\u0391\u03c5\u03c4\u03cc \u03b5\u03af\u03bd\u03b1\u03b9 \u03c4\u03bf \u03bb\u03b9\u03bc\u03ac\u03bd\u03b9 \u03b1\u03c0\u03cc \u03c4\u03bf \u03bf\u03c0\u03bf\u03af\u03bf \u03b8\u03b1 \u03c0\u03c1\u03bf\u03c3\u03b2\u03ac\u03bb\u03bb\u03b5\u03c4\u03b1\u03b9 \u03c4\u03bf\u03bd \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7 \u03c4\u03bf\u03c0\u03b9\u03ba\u03ac.";
    t[1186] = "Require local authorization for this service";
    t[1187] = "\u0391\u03c0\u03b1\u03b9\u03c4\u03b5\u03af\u03c4\u03b1\u03b9 \u03c4\u03bf\u03c0\u03b9\u03ba\u03ae \u03ac\u03b4\u03b5\u03b9\u03b1 \u03b3\u03b9\u03b1 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7\u03bd \u03c5\u03c0\u03b7\u03c1\u03b5\u03c3\u03af\u03b1";
    t[1202] = "Enables direct chat and file transfers, bypassing I2P. Note that this will compromise your anonymity and is not recommended.";
    t[1203] = "\u0395\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03b5\u03af \u03ac\u03bc\u03b5\u03c3\u03b7 \u03c3\u03c5\u03b6\u03ae\u03c4\u03b7\u03c3\u03b7 \u03ba\u03b1\u03b9 \u03bc\u03b5\u03c4\u03b1\u03c6\u03bf\u03c1\u03ac \u03b1\u03c1\u03c7\u03b5\u03af\u03c9\u03bd, \u03c0\u03b1\u03c1\u03b1\u03ba\u03ac\u03bc\u03bd\u03bf\u03bd\u03c4\u03b1\u03c2 \u03c4\u03bf I2P. \u03a3\u03b7\u03bc\u03b5\u03b9\u03ce\u03c3\u03c4\u03b5 \u03cc\u03c4\u03b9 \u03b1\u03c5\u03c4\u03cc \u03b8\u03b1 \u03c0\u03b1\u03c1\u03b1\u03b2\u03b9\u03ac\u03c3\u03b5\u03b9 \u03c4\u03b7\u03bd \u03b1\u03bd\u03ce\u03bd\u03c5\u03bc\u03b7 \u03c3\u03b1\u03c2 \u03b9\u03b4\u03b9\u03cc\u03c4\u03b7\u03c4\u03b1 \u03ba\u03b1\u03b9 \u03b4\u03b5\u03bd \u03c3\u03c5\u03bd\u03b9\u03c3\u03c4\u03ac\u03c4\u03b1\u03b9.";
    t[1204] = "Do not spoof User-Agent header";
    t[1205] = "\u039c\u03b7\u03bd \u03c0\u03b1\u03c1\u03b1\u03bc\u03b9\u03bc\u03b7\u03b8\u03b5\u03af \u03c4\u03bf User-Agent header";
    t[1208] = "Remote Credentials";
    t[1209] = "\u0395\u03be\u03c9\u03c4\u03b5\u03c1\u03b9\u03ba\u03ad\u03c2 \u03a0\u03b9\u03c3\u03c4\u03bf\u03c0\u03bf\u03b9\u03b7\u03c4\u03b9\u03ba\u03ad\u03c2";
    t[1210] = "Please be sure to select, copy, and paste the entire contents of the appropriate authentication data into the form of your favorite registration site";
    t[1211] = "\u03a0\u03b1\u03c1\u03b1\u03ba\u03b1\u03bb\u03ce \u03bd\u03b1 \u03b5\u03af\u03c3\u03c4\u03b5 \u03b2\u03ad\u03b2\u03b1\u03b9\u03bf\u03b9 \u03cc\u03c4\u03b9 \u03b5\u03c0\u03b9\u03bb\u03ad\u03b3\u03b5\u03c4\u03b5, \u03b1\u03bd\u03c4\u03b9\u03b3\u03c1\u03ac\u03c6\u03b5\u03c4\u03b5 \u03ba\u03b1\u03b9 \u03b5\u03c0\u03b9\u03ba\u03bf\u03bb\u03bb\u03ae\u03c3\u03c4\u03b5 \u03c4\u03bf \u03c3\u03cd\u03bd\u03bf\u03bb\u03bf \u03c4\u03c9\u03bd \u03c0\u03c1\u03bf\u03c3\u03b1\u03c1\u03bc\u03bf\u03c3\u03bc\u03ad\u03bd\u03c9\u03bd \u03b4\u03b5\u03b4\u03bf\u03bc\u03ad\u03bd\u03c9\u03bd \u03b1\u03c5\u03b8\u03b5\u03bd\u03c4\u03b9\u03ba\u03bf\u03c0\u03bf\u03af\u03b7\u03c3\u03b7\u03c2 \u03c3\u03c4\u03b7 \u03c6\u03cc\u03c1\u03bc\u03b1 \u03c4\u03b7\u03c2 \u03b1\u03b3\u03b1\u03c0\u03b7\u03bc\u03ad\u03bd\u03b7\u03c2 \u03c3\u03b1\u03c2 \u03b9\u03c3\u03c4\u03bf\u03c3\u03b5\u03bb\u03af\u03b4\u03b1\u03c2 \u03b5\u03b3\u03b3\u03c1\u03b1\u03c6\u03ae\u03c2";
    t[1212] = "Delay Connect";
    t[1213] = "\u039a\u03b1\u03b8\u03c5\u03c3\u03c4\u03ad\u03c1\u03b7\u03c3\u03b7 \u03a3\u03cd\u03bd\u03b4\u03b5\u03c3\u03b7\u03c2";
    t[1218] = "Website Hostname e.g. mysite.i2p";
    t[1219] = "\u038c\u03bd\u03bf\u03bc\u03b1 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae \u03b9\u03c3\u03c4\u03bf\u03c3\u03b5\u03bb\u03af\u03b4\u03b1\u03c2 \u03b3\u03b9\u03b1 \u03c0\u03b1\u03c1\u03ac\u03b4\u03b5\u03b9\u03b3\u03bc\u03b1 mysite.i2p";
    t[1234] = "Do not block Referer header";
    t[1235] = "\u039c\u03b7\u03bd \u03c6\u03b9\u03bb\u03c4\u03c1\u03ac\u03c1\u03b5\u03c4\u03b5 \u03c4\u03bf header Referer";
    t[1236] = "Automatically start tunnel when router starts";
    t[1237] = "\u0391\u03c5\u03c4\u03cc\u03bc\u03b1\u03c4\u03b7 \u03ad\u03bd\u03b1\u03c1\u03be\u03b7 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 \u03cc\u03c4\u03b1\u03bd \u03be\u03b5\u03ba\u03b9\u03bd\u03ac\u03b5\u03b9 \u03bf \u03b4\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ae\u03c2";
    t[1242] = "internal";
    t[1243] = "\u03b5\u03c3\u03c9\u03c4\u03b5\u03c1\u03b9\u03ba\u03cc";
    t[1244] = "Auto Start Tunnel";
    t[1245] = "\u0391\u03c5\u03c4\u03cc\u03bc\u03b1\u03c4\u03b7 \u0388\u03bd\u03b1\u03c1\u03be\u03b7 \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[1246] = "SSL Outproxies";
    t[1247] = "SSL Outproxies";
    t[1250] = "HTTPS configuration";
    t[1251] = "\u03a1\u03c5\u03b8\u03bc\u03af\u03b6\u03b5\u03c4\u03b1\u03b9 HTTPS";
    t[1256] = "Status Messages";
    t[1257] = "\u039c\u03b7\u03bd\u03cd\u03bc\u03b1\u03c4\u03b1 \u039a\u03b1\u03c4\u03ac\u03c3\u03c4\u03b1\u03c3\u03b7\u03c2";
    t[1262] = "Legacy option (deprecated), provided for backward compatibility";
    t[1263] = "\u03a0\u03b1\u03bb\u03b9\u03cc\u03c4\u03b5\u03c1\u03b7 \u03b5\u03c0\u03b9\u03bb\u03bf\u03b3\u03ae (\u03b5\u03be\u03b1\u03af\u03c1\u03b5\u03c3\u03b7), \u03c0\u03b1\u03c1\u03ad\u03c7\u03b5\u03c4\u03b1\u03b9 \u03b3\u03b9\u03b1 \u03c0\u03c1\u03bf\u03c2 \u03c4\u03b1 \u03c0\u03af\u03c3\u03c9 \u03c3\u03c5\u03bc\u03b2\u03b1\u03c4\u03cc\u03c4\u03b7\u03c4\u03b1";
    t[1264] = "Total";
    t[1265] = "\u03a3\u03cd\u03bd\u03bf\u03bb\u03bf";
    t[1266] = "I2CP Hostname or IP";
    t[1267] = "\u038c\u03bd\u03bf\u03bc\u03b1 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae I2CP \u03ae IP";
    t[1268] = "Standard server";
    t[1269] = "\u03a4\u03c5\u03c0\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03bf\u03c2 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae\u03c2";
    t[1272] = "IRC client";
    t[1273] = "\u03a0\u03b5\u03bb\u03ac\u03c4\u03b7\u03c2 IRC";
    t[1274] = "Only enable if you are hosting this service on multiple routers";
    t[1275] = "\u0395\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03ae\u03c3\u03c4\u03b5 \u03bc\u03cc\u03bd\u03bf \u03b1\u03bd \u03c6\u03b9\u03bb\u03bf\u03be\u03b5\u03bd\u03b5\u03af\u03c4\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7\u03bd \u03c5\u03c0\u03b7\u03c1\u03b5\u03c3\u03af\u03b1 \u03c3\u03b5 \u03c0\u03bf\u03bb\u03bb\u03b1\u03c0\u03bb\u03bf\u03cd\u03c2 \u03b4\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ad\u03c2";
    t[1278] = "no anonymity";
    t[1279] = "\u03c7\u03c9\u03c1\u03af\u03c2 \u03b1\u03bd\u03ce\u03bd\u03c5\u03bc\u03b7 \u03b9\u03b4\u03b9\u03cc\u03c4\u03b7\u03c4\u03b1";
    t[1282] = "Streamr server";
    t[1283] = "\u0394\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae\u03c2 Streamr";
    t[1292] = "Each IRC network in I2P that you wish to connect to will require its own tunnel. (See Also, SOCKS IRC)";
    t[1293] = "\u039a\u03ac\u03b8\u03b5 IRC \u03b4\u03af\u03ba\u03c4\u03c5\u03bf \u03c3\u03c4\u03bf I2P \u03c0\u03bf\u03c5 \u03b8\u03ad\u03bb\u03b5\u03c4\u03b5 \u03bd\u03b1 \u03c3\u03c5\u03bd\u03b4\u03b5\u03b8\u03b5\u03af\u03c4\u03b5 \u03b8\u03b1 \u03c7\u03c1\u03b5\u03b9\u03b1\u03c3\u03c4\u03b5\u03af \u03c4\u03bf \u03b4\u03b9\u03ba\u03cc \u03c4\u03bf\u03c5 \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf. (\u0394\u03b5\u03af\u03c4\u03b5 \u03b5\u03c0\u03af\u03c3\u03b7\u03c2, SOCKS IRC)";
    t[1296] = "Enable Direct Client-to-Client protocol";
    t[1297] = "\u0395\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03af\u03b7\u03c3\u03b7 \u03c4\u03bf\u03c5 \u03ac\u03bc\u03b5\u03c3\u03bf\u03c5 \u03c0\u03c1\u03c9\u03c4\u03bf\u03ba\u03cc\u03bb\u03bb\u03bf\u03c5 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7-\u03c0\u03c1\u03bf\u03c2-\u03c0\u03b5\u03bb\u03ac\u03c4\u03b7";
    t[1302] = "A tunnel that implements the SOCKS protocol.";
    t[1303] = "\u0394\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03c0\u03bf\u03c5 \u03b5\u03c6\u03b1\u03c1\u03bc\u03cc\u03b6\u03b5\u03b9 \u03c4\u03bf \u03c0\u03c1\u03c9\u03c4\u03cc\u03ba\u03bf\u03bb\u03bb\u03bf SOCKS.";
    t[1304] = "Referrer-Policy";
    t[1305] = "\u03a0\u03bf\u03bb\u03b9\u03c4\u03b9\u03ba\u03ae Referrer";
    t[1310] = "Send key and password to all users.";
    t[1311] = "\u0391\u03c0\u03bf\u03c3\u03c4\u03bf\u03bb\u03ae \u03ba\u03bb\u03b5\u03b9\u03b4\u03b9\u03bf\u03cd \u03ba\u03b1\u03b9 \u03ba\u03c9\u03b4\u03b9\u03ba\u03bf\u03cd \u03c0\u03c1\u03cc\u03c3\u03b2\u03b1\u03c3\u03b7\u03c2 \u03c3\u03b5 \u03cc\u03bb\u03bf\u03c5\u03c2 \u03c4\u03bf\u03c5\u03c2 \u03c7\u03c1\u03ae\u03c3\u03c4\u03b5\u03c2.";
    t[1318] = "I2P Tunnel Manager - Tunnel Creation Wizard";
    t[1319] = "\u0394\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ae\u03c2 \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 I2P - \u03a6\u03bf\u03b9\u03c4\u03b7\u03c4\u03ae\u03c2 \u0394\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03af\u03b1\u03c2 \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[1320] = "If a client exceeds the maximum number of post requests per allocated period, enforce a ban for this number of minutes";
    t[1321] = "\u0391\u03bd \u03ad\u03bd\u03b1\u03c2 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7\u03c2 \u03c5\u03c0\u03b5\u03c1\u03b2\u03b1\u03af\u03bd\u03b5\u03b9 \u03c4\u03bf\u03bd \u03bc\u03ad\u03b3\u03b9\u03c3\u03c4\u03bf \u03b1\u03c1\u03b9\u03b8\u03bc\u03cc \u03b1\u03b9\u03c4\u03b7\u03bc\u03ac\u03c4\u03c9\u03bd post \u03b1\u03bd\u03ac \u03b4\u03b9\u03b1\u03b8\u03ad\u03c3\u03b9\u03bc\u03b7 \u03c0\u03b5\u03c1\u03af\u03bf\u03b4\u03bf, \u03b5\u03c6\u03b1\u03c1\u03bc\u03cc\u03c3\u03c4\u03b5 \u03b1\u03c0\u03bf\u03ba\u03bb\u03bf\u03c4\u03b9\u03c3\u03bc\u03cc \u03b3\u03b9\u03b1 \u03b1\u03c5\u03c4\u03cc \u03c4\u03bf\u03bd \u03b1\u03c1\u03b9\u03b8\u03bc\u03cc \u03bb\u03b5\u03c0\u03c4\u03ce\u03bd";
    t[1324] = "Allow SSL to I2P addresses when enabled";
    t[1325] = "\u0395\u03c0\u03b9\u03c4\u03c1\u03ad\u03c0\u03b5\u03c4\u03b5 SSL \u03c3\u03b5 \u03b4\u03b9\u03b5\u03c5\u03b8\u03cd\u03bd\u03c3\u03b5\u03b9\u03c2 I2P \u03cc\u03c4\u03b1\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03b7";
    t[1326] = "Incoming I2P Port Routing";
    t[1327] = "\u0395\u03b9\u03c3\u03b5\u03c1\u03c7\u03cc\u03bc\u03b5\u03bd\u03b7 \u03a1\u03bf\u03b4\u03b1\u03c6\u03bf\u03c1\u03af\u03b1 \u039b\u03b9\u03bc\u03b1\u03bd\u03b9\u03bf\u03cd I2P";
    t[1330] = "Website Hostname";
    t[1331] = "\u038c\u03bd\u03bf\u03bc\u03b1 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae \u03b9\u03c3\u03c4\u03bf\u03c3\u03b5\u03bb\u03af\u03b4\u03b1\u03c2";
