    t[1336] = "Username";
    t[1337] = "\u038c\u03bd\u03bf\u03bc\u03b1 \u03c7\u03c1\u03ae\u03c3\u03c4\u03b7";
    t[1340] = "Specify the port the server is running on";
    t[1341] = "\u039f\u03c1\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf \u03bb\u03b9\u03bc\u03ac\u03bd\u03b9 \u03c3\u03c4\u03bf \u03bf\u03c0\u03bf\u03af\u03bf \u03c4\u03c1\u03ad\u03c7\u03b5\u03b9 \u03bf \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae\u03c2";
    t[1342] = "Absolute path to Private Key File (will be created if it does not exist)";
    t[1343] = "\u0391\u03c0\u03cc\u03bb\u03c5\u03c4\u03b7 \u03b4\u03b9\u03b5\u03cd\u03b8\u03c5\u03bd\u03c3\u03b7 \u03c3\u03c4\u03bf \u03b1\u03c1\u03c7\u03b5\u03af\u03bf \u0399\u03b4\u03b9\u03c9\u03c4\u03b9\u03ba\u03ae\u03c2 \u039a\u03bb\u03b5\u03b9\u03b4\u03b9\u03ac\u03c2 (\u03b8\u03b1 \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03b7\u03b8\u03b5\u03af \u03b1\u03bd \u03b4\u03b5\u03bd \u03c5\u03c0\u03ac\u03c1\u03c7\u03b5\u03b9)";
    t[1348] = "Local destination is not available. Start the tunnel.";
    t[1349] = "\u03a4\u03bf \u03c4\u03bf\u03c0\u03b9\u03ba\u03cc\u03c2 \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03cc\u03c2 \u03b4\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03b4\u03b9\u03b1\u03b8\u03ad\u03c3\u03b9\u03bc\u03bf\u03c2. \u0391\u03c1\u03c7\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf\u03bd \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf.";
    t[1352] = "definitely not recommended";
    t[1353] = "\u03c3\u03af\u03b3\u03bf\u03c5\u03c1\u03b1 \u03b4\u03b5\u03bd \u03c3\u03c5\u03bd\u03b9\u03c3\u03c4\u03ac\u03c4\u03b1\u03b9";
    t[1360] = "in";
    t[1361] = "\u03b5\u03bd\u03c4\u03cc\u03c2";
    t[1366] = "Save Tunnel";
    t[1367] = "\u0391\u03c0\u03bf\u03b8\u03ae\u03ba\u03b5\u03c5\u03c3\u03b7 \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[1372] = "Legacy option, with alternate key configured";
    t[1373] = "\u03a0\u03b1\u03bb\u03b9\u03ac \u03b5\u03c0\u03b9\u03bb\u03bf\u03b3\u03ae, \u03bc\u03b5 \u03b5\u03bd\u03b1\u03bb\u03bb\u03b1\u03ba\u03c4\u03b9\u03ba\u03cc \u03ba\u03bb\u03b5\u03b9\u03b4\u03af \u03c1\u03c5\u03b8\u03bc\u03b9\u03c3\u03bc\u03ad\u03bd\u03bf";
    t[1376] = "Blinded with lookup password";
    t[1377] = "Blinded \u03bc\u03b5 \u03ba\u03c9\u03b4\u03b9\u03ba\u03cc \u03c0\u03c1\u03cc\u03c3\u03b2\u03b1\u03c3\u03b7\u03c2 Lookup";
    t[1382] = "Hostname";
    t[1383] = "\u038c\u03bd\u03bf\u03bc\u03b1 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae";
    t[1390] = "Signature";
    t[1391] = "\u03a5\u03c0\u03bf\u03b3\u03c1\u03b1\u03c6\u03ae";
    t[1396] = "Custom HTTP Headers";
    t[1397] = "\u03a0\u03c1\u03bf\u03c3\u03b1\u03c1\u03bc\u03bf\u03c3\u03bc\u03ad\u03bd\u03b1 Headers HTTP";
