    t[1399] = "\u03a4\u03cd\u03c0\u03bf\u03c2 \u03c5\u03c0\u03bf\u03b3\u03c1\u03b1\u03c6\u03ae\u03c2";
    t[1400] = "Block Accesses containing Referers";
    t[1401] = "\u0391\u03c0\u03bf\u03ba\u03bb\u03b5\u03af\u03c3\u03c4\u03b5 \u03c4\u03b9\u03c2 \u03c0\u03c1\u03bf\u03c3\u03c0\u03ac\u03b8\u03b5\u03b9\u03b5\u03c2 \u03c0\u03c1\u03cc\u03c3\u03b2\u03b1\u03c3\u03b7\u03c2 \u03c0\u03bf\u03c5 \u03c0\u03b5\u03c1\u03b9\u03ad\u03c7\u03bf\u03c5\u03bd Referers";
    t[1404] = "Finish Wizard and review tunnel settings";
    t[1405] = "\u039f\u03bb\u03bf\u03ba\u03bb\u03ae\u03c1\u03c9\u03c3\u03b7 \u03c4\u03bf\u03c5 \u03c6\u03bf\u03b9\u03c4\u03b7\u03c4\u03ae \u03ba\u03b1\u03b9 \u03b1\u03bd\u03b1\u03b8\u03b5\u03ce\u03c1\u03b7\u03c3\u03b7 \u03c4\u03c9\u03bd \u03c1\u03c5\u03b8\u03bc\u03af\u03c3\u03b5\u03c9\u03bd \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[1408] = "Only allow listed clients to connect to this service";
    t[1409] = "\u0391\u03c0\u03bf\u03ba\u03bb\u03b5\u03af\u03c3\u03c4\u03b5 \u03cc\u03bb\u03bf\u03c5\u03c2 \u03b5\u03ba\u03c4\u03cc\u03c2 \u03b1\u03c0\u03cc \u03c4\u03bf\u03c5\u03c2 \u03ba\u03b1\u03c4\u03b1\u03c7\u03c9\u03c1\u03b7\u03bc\u03ad\u03bd\u03bf\u03c5\u03c2 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b5\u03c2 \u03b1\u03c0\u03cc \u03bd\u03b1 \u03c3\u03c5\u03bd\u03b4\u03b5\u03b8\u03bf\u03cd\u03bd \u03c3\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7\u03bd \u03c5\u03c0\u03b7\u03c1\u03b5\u03c3\u03af\u03b1";
    t[1410] = "The wizard will set reasonably sensible default values for these, but you can view and/or edit these by clicking on the tunnel's name in the main I2PTunnel page.";
    t[1411] = "\u039f \u03c6\u03bf\u03b9\u03c4\u03b7\u03c4\u03ae\u03c2 \u03b8\u03b1 \u03bf\u03c1\u03af\u03c3\u03b5\u03b9 \u03bb\u03bf\u03b3\u03b9\u03ba\u03ad\u03c2 \u03c0\u03c1\u03bf\u03b5\u03c0\u03b9\u03bb\u03b5\u03b3\u03bc\u03ad\u03bd\u03b5\u03c2 \u03c4\u03b9\u03bc\u03ad\u03c2 \u03b3\u03b9\u03b1 \u03b1\u03c5\u03c4\u03ad\u03c2, \u03b1\u03bb\u03bb\u03ac \u03bc\u03c0\u03bf\u03c1\u03b5\u03af\u03c4\u03b5 \u03bd\u03b1 \u03c4\u03b9\u03c2 \u03b4\u03b5\u03af\u03c4\u03b5 \u03ba\u03b1\u03b9/\u03ae \u03bd\u03b1 \u03c4\u03b9\u03c2 \u03b5\u03c0\u03b5\u03be\u03b5\u03c1\u03b3\u03b1\u03c3\u03c4\u03b5\u03af\u03c4\u03b5 \u03ba\u03ac\u03bd\u03bf\u03bd\u03c4\u03b1\u03c2 \u03ba\u03bb\u03b9\u03ba \u03c3\u03c4\u03bf \u03cc\u03bd\u03bf\u03bc\u03b1 \u03c4\u03bf\u03c5 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 \u03c3\u03c4\u03b7\u03bd \u03ba\u03cd\u03c1\u03b9\u03b1 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1 \u03c4\u03bf\u03c5 I2PTunnel.";
    t[1414] = "Enable Cache-Control headers (no-cache for html, xml, json and text, immutable for everything else)";
    t[1415] = "\u0395\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03ae\u03c3\u03c4\u03b5 \u03c4\u03b1 headers Cache-Control (no-cache \u03b3\u03b9\u03b1 html, xml, json \u03ba\u03b1\u03b9 text, immutable \u03b3\u03b9\u03b1 \u03cc\u03bb\u03b1 \u03c4\u03b1 \u03ac\u03bb\u03bb\u03b1)";
    t[1424] = "Alternate private key file";
    t[1425] = "\u0395\u03bd\u03b1\u03bb\u03bb\u03b1\u03ba\u03c4\u03b9\u03ba\u03cc \u03b1\u03c1\u03c7\u03b5\u03af\u03bf \u03b9\u03b4\u03b9\u03c9\u03c4\u03b9\u03ba\u03ae\u03c2 \u03ba\u03bb\u03b5\u03b9\u03b4\u03b9\u03ac\u03c2";
    t[1430] = "See above for required items.";
    t[1431] = "\u0394\u03b5\u03af\u03c4\u03b5 \u03c0\u03b1\u03c1\u03b1\u03c0\u03ac\u03bd\u03c9 \u03b3\u03b9\u03b1 \u03c4\u03b1 \u03b1\u03c0\u03b1\u03b9\u03c4\u03bf\u03cd\u03bc\u03b5\u03bd\u03b1 \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03b1.";
    t[1432] = "Conserve resources by only creating tunnels when required";
    t[1433] = "\u03a0\u03b1\u03c1\u03b1\u03c4\u03ae\u03c1\u03b7\u03c3\u03b7 \u03c0\u03cc\u03c1\u03c9\u03bd \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03ce\u03bd\u03c4\u03b1\u03c2 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5\u03c2 \u03bc\u03cc\u03bd\u03bf \u03cc\u03c4\u03b1\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03c0\u03b1\u03c1\u03b1\u03af\u03c4\u03b7\u03c4\u03bf";
    t[1438] = "IRC server";
    t[1439] = "\u0394\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae\u03c2 IRC";
    t[1440] = "Advance to next page";
    t[1441] = "\u039c\u03b5\u03c4\u03ac\u03b2\u03b1\u03c3\u03b7 \u03c3\u03c4\u03b7\u03bd \u03b5\u03c0\u03cc\u03bc\u03b5\u03bd\u03b7 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1";
    t[1444] = "Tunnel must be stopped first";
    t[1445] = "\u039f \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c3\u03c4\u03b1\u03bc\u03b1\u03c4\u03ae\u03c3\u03b5\u03b9 \u03c0\u03c1\u03ce\u03c4\u03b1";
    t[1452] = "Alternate";
    t[1453] = "\u0395\u03bd\u03b1\u03bb\u03bb\u03b1\u03ba\u03c4\u03b9\u03ba\u03cc\u03c2";
    t[1458] = "Destination signing key is offline. Use CLI tools on the offline machine.";
    t[1459] = "\u039f \u03ba\u03bb\u03b5\u03b9\u03b4\u03af\u03c2 \u03c5\u03c0\u03bf\u03b3\u03c1\u03b1\u03c6\u03ae\u03c2 \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03bf\u03cd \u03b5\u03af\u03bd\u03b1\u03b9 offline. \u03a7\u03c1\u03b7\u03c3\u03b9\u03bc\u03bf\u03c0\u03bf\u03b9\u03ae\u03c3\u03c4\u03b5 \u03b5\u03c1\u03b3\u03b1\u03bb\u03b5\u03af\u03b1 CLI \u03c3\u03c4\u03bf\u03bd offline \u03c5\u03c0\u03bf\u03bb\u03bf\u03b3\u03b9\u03c3\u03c4\u03ae.";
    t[1460] = "Password";
    t[1461] = "\u039a\u03c9\u03b4\u03b9\u03ba\u03cc\u03c2";
    t[1466] = "This tunnel must be configured with the new destination.";
    t[1467] = "\u0391\u03c5\u03c4\u03cc\u03c2 \u03bf \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c1\u03c5\u03b8\u03bc\u03b9\u03c3\u03bc\u03ad\u03bd\u03bf\u03c2 \u03bc\u03b5 \u03c4\u03bf\u03bd \u03bd\u03ad\u03bf \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03cc.";
    t[1470] = "Are you sure you want to delete?";
    t[1471] = "\u0395\u03af\u03c3\u03c4\u03b5 \u03b2\u03ad\u03b2\u03b1\u03b9\u03bf\u03b9 \u03cc\u03c4\u03b9 \u03b8\u03ad\u03bb\u03b5\u03c4\u03b5 \u03bd\u03b1 \u03b4\u03b9\u03b1\u03b3\u03c1\u03ac\u03c8\u03b5\u03c4\u03b5?";
    t[1476] = "Enter a b64 or .i2p address here";
    t[1477] = "\u0395\u03b9\u03c3\u03ac\u03b3\u03b5\u03c4\u03b5 \u03bc\u03b9\u03b1 b64 \u03ae .i2p \u03b4\u03b9\u03b5\u03cd\u03b8\u03c5\u03bd\u03c3\u03b7 \u03b5\u03b4\u03ce";
    t[1490] = "Note: When this client is configured to share tunnels, these options apply to all clients configured to share tunnels.";
    t[1491] = "\u03a3\u03b7\u03bc\u03b5\u03af\u03c9\u03c3\u03b7: \u038c\u03c4\u03b1\u03bd \u03b1\u03c5\u03c4\u03cc\u03c2 \u03bf \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c1\u03c5\u03b8\u03bc\u03b9\u03c3\u03bc\u03ad\u03bd\u03bf\u03c2 \u03b3\u03b9\u03b1 \u03ba\u03bf\u03b9\u03bd\u03ae \u03c7\u03c1\u03ae\u03c3\u03b7 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03c9\u03bd, \u03b1\u03c5\u03c4\u03ad\u03c2 \u03bf\u03b9 \u03b5\u03c0\u03b9\u03bb\u03bf\u03b3\u03ad\u03c2 \u03b9\u03c3\u03c7\u03cd\u03bf\u03c5\u03bd \u03b3\u03b9\u03b1 \u03cc\u03bb\u03bf\u03c5\u03c2 \u03c4\u03bf\u03c5\u03c2 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b5\u03c2 \u03c0\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c1\u03c5\u03b8\u03bc\u03b9\u03c3\u03bc\u03ad\u03bd\u03bf\u03b9 \u03b3\u03b9\u03b1 \u03ba\u03bf\u03b9\u03bd\u03ae \u03c7\u03c1\u03ae\u03c3\u03b7 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03c9\u03bd.";
    t[1502] = "Reachable by";
    t[1503] = "\u03a0\u03c1\u03bf\u03c3\u03b2\u03ac\u03c3\u03b9\u03bc\u03bf \u03b1\u03c0\u03cc";
    t[1508] = "Customised client tunnel specific for IRC connections.";
    t[1509] = "\u03a0\u03c1\u03bf\u03c3\u03b1\u03c1\u03bc\u03bf\u03c3\u03bc\u03ad\u03bd\u03bf\u03c2 \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7 \u03c0\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c3\u03c5\u03b3\u03ba\u03b5\u03ba\u03c1\u03b9\u03bc\u03ad\u03bd\u03bf\u03c2 \u03b3\u03b9\u03b1 \u03c3\u03c5\u03bd\u03b4\u03ad\u03c3\u03b5\u03b9\u03c2 IRC.";
    t[1514] = "With this tunnel type, IRC networks in I2P can be reached by typing the I2P address into your IRC client, and configuring the IRC client to use this SOCKS tunnel.";
    t[1515] = "\u039c\u03b5 \u03b1\u03c5\u03c4\u03cc \u03c4\u03bf \u03b5\u03af\u03b4\u03bf\u03c2 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5, \u03c4\u03b1 IRC \u03b4\u03af\u03ba\u03c4\u03c5\u03b1 \u03c3\u03c4\u03bf I2P \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03bd \u03bd\u03b1 \u03c0\u03c1\u03bf\u03c3\u03c7\u03c9\u03c1\u03ae\u03c3\u03bf\u03c5\u03bd \u03c0\u03bb\u03b7\u03ba\u03c4\u03c1\u03bf\u03bb\u03bf\u03b3\u03ce\u03bd\u03c4\u03b1\u03c2 \u03c4\u03b7 \u03b4\u03b9\u03b5\u03cd\u03b8\u03c5\u03bd\u03c3\u03b7 I2P \u03c3\u03c4\u03bf\u03bd \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7 IRC \u03c3\u03b1\u03c2, \u03ba\u03b1\u03b9 \u03c1\u03c5\u03b8\u03bc\u03af\u03b6\u03bf\u03bd\u03c4\u03b1\u03c2 \u03c4\u03bf\u03bd \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7 IRC \u03bd\u03b1 \u03c7\u03c1\u03b7\u03c3\u03b9\u03bc\u03bf\u03c0\u03bf\u03b9\u03b5\u03af \u03b1\u03c5\u03c4\u03cc\u03bd \u03c4\u03bf\u03bd \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf SOCKS.";
    t[1520] = "When enabled, the accept headers (mime types support) broadcast by your web browser will not be filtered, potentially reducing your anonymity";
    t[1521] = "\u038c\u03c4\u03b1\u03bd \u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03b7\u03b8\u03b5\u03af, \u03c4\u03b1 header accept (\u03c3\u03c4\u03ae\u03c1\u03b9\u03be\u03b7 mime types) \u03c0\u03bf\u03c5 \u03b1\u03c0\u03bf\u03c3\u03c4\u03ad\u03bb\u03bb\u03bf\u03bd\u03c4\u03b1\u03b9 \u03b1\u03c0\u03cc \u03c4\u03bf\u03bd \u03c0\u03b5\u03c1\u03b9\u03b7\u03b3\u03b7\u03c4\u03ae \u03c3\u03b1\u03c2 \u03b4\u03b5\u03bd \u03b8\u03b1 \u03c6\u03af\u03bb\u03c4\u03c1\u03b1\u03c1\u03b1\u03bd, \u03bc\u03b5 \u03b1\u03c0\u03bf\u03c4\u03ad\u03bb\u03b5\u03c3\u03bc\u03b1 \u03b7 \u03b1\u03bd\u03ce\u03bd\u03c5\u03bc\u03b7 \u03b9\u03b4\u03b9\u03cc\u03c4\u03b7\u03c4\u03ac \u03c3\u03b1\u03c2 \u03bd\u03b1 \u03bc\u03b5\u03b9\u03c9\u03b8\u03b5\u03af";
    t[1532] = "When enabled, the referer (originating page) of your web requests will not be filtered, potentially reducing your anonymity";
    t[1533] = "\u038c\u03c4\u03b1\u03bd \u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03b7\u03b8\u03b5\u03af, \u03bf referer (\u03c4\u03b7\u03c2 \u03b1\u03c1\u03c7\u03b9\u03ba\u03ae\u03c2 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1\u03c2) \u03c4\u03c9\u03bd \u03b1\u03b9\u03c4\u03b7\u03bc\u03ac\u03c4\u03c9\u03bd web \u03c3\u03b1\u03c2 \u03b4\u03b5\u03bd \u03b8\u03b1 \u03c6\u03af\u03bb\u03c4\u03c1\u03b1\u03c1\u03b5, \u03bc\u03b5 \u03b1\u03c0\u03bf\u03c4\u03ad\u03bb\u03b5\u03c3\u03bc\u03b1 \u03b7 \u03b1\u03bd\u03ce\u03bd\u03c5\u03bc\u03b7 \u03b9\u03b4\u03b9\u03cc\u03c4\u03b7\u03c4\u03ac \u03c3\u03b1\u03c2 \u03bd\u03b1 \u03bc\u03b5\u03b9\u03c9\u03b8\u03b5\u03af";
    t[1534] = "I2P Client Tunnels";
    t[1535] = "\u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03b9 \u03a0\u03b5\u03bb\u03ac\u03c4\u03b7 I2P";
    t[1536] = "(leave blank for outproxies)";
    t[1537] = "(\u03b1\u03c6\u03ae\u03c3\u03c4\u03b5 \u03ba\u03b5\u03bd\u03cc \u03b3\u03b9\u03b1 outproxies)";
    t[1540] = "New server tunnel";
    t[1541] = "\u039d\u03ad\u03bf\u03c2 \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae";
    t[1542] = "Registration Helper";
    t[1543] = "\u0392\u03bf\u03b7\u03b8\u03cc\u03c2 \u0395\u03b3\u03b3\u03c1\u03b1\u03c6\u03ae\u03c2";
    t[1544] = "Keyring Manager";
    t[1545] = "\u0394\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ae\u03c2 Keyring";
    t[1550] = "Destination";
    t[1551] = "\u03a0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03cc\u03c2";
    t[1554] = "1 hop tunnel (low anonymity)";
    t[1555] = "1 \u03ba\u03bb\u03af\u03c3\u03bc\u03b1 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 (\u03bc\u03b9\u03ba\u03c1\u03ae \u03b1\u03bd\u03ce\u03bd\u03c5\u03bc\u03b7 \u03b9\u03b4\u03b9\u03cc\u03c4\u03b7\u03c4\u03b1)";
    t[1570] = "Cannot configure, no Jetty server found in {0}client configurations{1} that matches this tunnel";
    t[1571] = "\u0394\u03b5\u03bd \u03bc\u03c0\u03bf\u03c1\u03b5\u03af \u03bd\u03b1 \u03c1\u03c5\u03b8\u03bc\u03b9\u03c3\u03c4\u03b5\u03af, \u03b4\u03b5\u03bd \u03b2\u03c1\u03ad\u03b8\u03b7\u03ba\u03b5 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae\u03c2 Jetty \u03c3\u03c4\u03b9\u03c2 {0}\u03c1\u03c5\u03b8\u03bc\u03af\u03c3\u03b5\u03b9\u03c2 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7{1} \u03c0\u03bf\u03c5 \u03bd\u03b1 \u03c4\u03b1\u03b9\u03c1\u03b9\u03ac\u03b6\u03b5\u03b9 \u03c3\u03b5 \u03b1\u03c5\u03c4\u03cc\u03bd \u03c4\u03bf\u03bd \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf";
    t[1572] = "This enables both TCP and UDP connections to be made through a SOCKS outproxy within I2P.";
    t[1573] = "\u0391\u03c5\u03c4\u03cc \u03b5\u03c0\u03b9\u03c4\u03c1\u03ad\u03c0\u03b5\u03b9 \u03c4\u03cc\u03c3\u03bf \u03c3\u03c5\u03bd\u03b4\u03ad\u03c3\u03b5\u03b9\u03c2 TCP \u03cc\u03c3\u03bf \u03ba\u03b1\u03b9 UDP \u03bd\u03b1 \u03b4\u03b9\u03b5\u03be\u03b1\u03b3\u03c9\u03b3\u03b5\u03af\u03c4\u03b1\u03b9 \u03bc\u03ad\u03c3\u03c9 \u03b5\u03bd\u03cc\u03c2 SOCKS outproxy \u03bc\u03ad\u03c3\u03b1 \u03c3\u03c4\u03bf I2P.";
    t[1574] = "Tunnel that acts as an HTTP proxy for reaching eepsites inside I2P.";
    t[1575] = "\u0394\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03c0\u03bf\u03c5 \u03bb\u03b5\u03b9\u03c4\u03bf\u03c5\u03c1\u03b3\u03b5\u03af \u03c9\u03c2 HTTP proxy \u03b3\u03b9\u03b1 \u03c4\u03b7\u03bd \u03c0\u03c1\u03cc\u03c3\u03b2\u03b1\u03c3\u03b7 \u03c3\u03b5 eepsites \u03bc\u03ad\u03c3\u03b1 \u03c3\u03c4\u03bf I2P.";
    t[1582] = "Level of Randomization for Tunnel Depth";
    t[1583] = "\u0395\u03c0\u03af\u03c0\u03b5\u03b4\u03bf \u03a3\u03c5\u03bd\u03c4\u03c5\u03c7\u03b1\u03b9\u03cc\u03c4\u03b7\u03c4\u03b1\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03b7 \u03b2\u03ac\u03b8\u03bf\u03c2 \u03c4\u03bf\u03c5 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[1590] = "Experts only!";
    t[1591] = "\u039c\u03cc\u03bd\u03bf \u03b3\u03b9\u03b1 \u03b5\u03b9\u03b4\u03b9\u03ba\u03bf\u03cd\u03c2!";
    t[1598] = "Enter old destination below.";
    t[1599] = "\u0395\u03b9\u03c3\u03ac\u03b3\u03b5\u03c4\u03b5 \u03c4\u03bf\u03bd \u03c0\u03b1\u03bb\u03b9\u03cc \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03cc \u03c0\u03b1\u03c1\u03b1\u03ba\u03ac\u03c4\u03c9.";
    t[1604] = "{0} hop tunnel";
    t[1605] = new java.lang.String[] { "{0} \u03ba\u03bb\u03af\u03c3\u03bc\u03b1\u03c4\u03b1 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5", "{0} \u03ba\u03bb\u03af\u03c3\u03bc\u03b1\u03c4\u03b1 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5" };
    t[1612] = "Select tunnel type";
    t[1613] = "\u0395\u03c0\u03b9\u03bb\u03bf\u03b3\u03ae \u03c4\u03cd\u03c0\u03bf\u03c5 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[1618] = "none";
    t[1619] = "\u03ba\u03b1\u03bd\u03ad\u03bd\u03b1\u03c2";
    t[1624] = "2 hop tunnel (medium anonymity)";
    t[1625] = "2 \u03ba\u03bb\u03af\u03c3\u03bc\u03b1\u03c4\u03b1 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 (\u03bc\u03ad\u03c4\u03c1\u03b9\u03b1 \u03b1\u03bd\u03ce\u03bd\u03c5\u03bc\u03b7 \u03b9\u03b4\u03b9\u03cc\u03c4\u03b7\u03c4\u03b1)";
    t[1634] = "Name";
    t[1635] = "\u038c\u03bd\u03bf\u03bc\u03b1";
    t[1640] = "If you know of any outproxies for this type of tunnel (either HTTP or SOCKS), fill them in below.";
    t[1641] = "\u0391\u03bd \u03b3\u03bd\u03c9\u03c1\u03af\u03b6\u03b5\u03c4\u03b5 \u03bf\u03c0\u03bf\u03b9\u03b1\u03b4\u03ae\u03c0\u03bf\u03c4\u03b5 outproxies \u03b3\u03b9\u03b1 \u03b1\u03c5\u03c4\u03cc \u03c4\u03bf \u03b5\u03af\u03b4\u03bf\u03c2 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 (\u03b5\u03af\u03c4\u03b5 HTTP \u03b5\u03af\u03c4\u03b5 SOCKS), \u03c3\u03c5\u03bc\u03c0\u03bb\u03b7\u03c1\u03ce\u03c3\u03c4\u03b5 \u03c4\u03b1 \u03c0\u03b1\u03c1\u03b1\u03ba\u03ac\u03c4\u03c9.";
    t[1644] = "Host not set";
    t[1645] = "\u039f \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae\u03c2 \u03b4\u03b5\u03bd \u03ad\u03c7\u03b5\u03b9 \u03bf\u03c1\u03b9\u03c3\u03c4\u03b5\u03af";
    t[1652] = "standard randomization, standard performance";
    t[1653] = "\u03c4\u03c5\u03c0\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03b7 \u03c3\u03c5\u03bd\u03c4\u03c5\u03c7\u03b1\u03b9\u03cc\u03c4\u03b7\u03c4\u03b1, \u03c4\u03c5\u03c0\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03b7 \u03b1\u03c0\u03cc\u03b4\u03bf\u03c3\u03b7";
    t[1654] = "Recommended for blinded and encrypted destinations";
    t[1655] = "\u03a3\u03c5\u03bd\u03b9\u03c3\u03c4\u03ac\u03c4\u03b1\u03b9 \u03b3\u03b9\u03b1 \u03c4\u03bf\u03c5\u03c2 \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03bf\u03cd\u03c2 \u03c0\u03bf\u03c5 \u03c4\u03c5\u03c0\u03b9\u03ba\u03ac \u03ba\u03c1\u03c5\u03c0\u03c4\u03bf\u03b3\u03c1\u03b1\u03c6\u03bf\u03cd\u03bd\u03c4\u03b1\u03b9 \u03ba\u03b1\u03b9 \u03c4\u03c5\u03c0\u03b9\u03ba\u03ac \u03c0\u03b1\u03c1\u03b1\u03bb\u03b1\u03bc\u03b2\u03ac\u03bd\u03bf\u03bd\u03c4\u03b1\u03b9";
    t[1656] = "Support for non-Jetty servers will be added in a future release";
    t[1657] = "\u0397 \u03c5\u03c0\u03bf\u03c3\u03c4\u03ae\u03c1\u03b9\u03be\u03b7 \u03b3\u03b9\u03b1 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ad\u03c2 \u03bc\u03b7 Jetty \u03b8\u03b1 \u03c0\u03c1\u03bf\u03c3\u03c4\u03b5\u03b8\u03b5\u03af \u03c3\u03b5 \u03bc\u03b5\u03bb\u03bb\u03bf\u03bd\u03c4\u03b9\u03ba\u03ae \u03ad\u03ba\u03b4\u03bf\u03c3\u03b7";
    t[1658] = "Finish";
    t[1659] = "\u039f\u03bb\u03bf\u03ba\u03bb\u03ae\u03c1\u03c9\u03c3\u03b7";
    t[1660] = "Port required to access service (this can be a different port to the port the service is hosted on)";
    t[1661] = "\u039b\u03b9\u03bc\u03ac\u03bd\u03b9 \u03c0\u03bf\u03c5 \u03b1\u03c0\u03b1\u03b9\u03c4\u03b5\u03af\u03c4\u03b1\u03b9 \u03b3\u03b9\u03b1 \u03c0\u03c1\u03cc\u03c3\u03b2\u03b1\u03c3\u03b7 \u03c3\u03c4\u03b7\u03bd \u03c5\u03c0\u03b7\u03c1\u03b5\u03c3\u03af\u03b1 (\u03b1\u03c5\u03c4\u03cc \u03bc\u03c0\u03bf\u03c1\u03b5\u03af \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03ad\u03bd\u03b1 \u03b4\u03b9\u03b1\u03c6\u03bf\u03c1\u03b5\u03c4\u03b9\u03ba\u03cc \u03bb\u03b9\u03bc\u03ac\u03bd\u03b9 \u03b1\u03c0\u03cc \u03b1\u03c5\u03c4\u03cc \u03c0\u03bf\u03c5 \u03c6\u03b9\u03bb\u03bf\u03be\u03b5\u03bd\u03b5\u03af\u03c4\u03b1\u03b9 \u03b7 \u03c5\u03c0\u03b7\u03c1\u03b5\u03c3\u03af\u03b1)";
