    t[1837] = "\u03a3\u03b7\u03bc\u03b5\u03af\u03c9\u03c3\u03b7: \u0393\u03b9\u03b1 \u03bd\u03b1 \u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03ae\u03c3\u03b5\u03c4\u03b5 \u03c4\u03b7 \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03af\u03b1 \u03ba\u03c9\u03b4\u03b9\u03ba\u03bf\u03cd QR \u03ae \u03c4\u03b7\u03bd \u03b1\u03c5\u03b8\u03b5\u03bd\u03c4\u03b9\u03ba\u03cc\u03c4\u03b7\u03c4\u03b1 \u03b5\u03b3\u03b3\u03c1\u03b1\u03c6\u03ae\u03c2, \u03c1\u03c5\u03b8\u03bc\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf \u03c0\u03b5\u03b4\u03af\u03bf \u039f\u03bd\u03bf\u03bc\u03b1\u03c3\u03af\u03b1 \u0399\u03c3\u03c4\u03bf\u03c3\u03b5\u03bb\u03af\u03b4\u03b1\u03c2 (\u03b3\u03b9\u03b1 \u03b9\u03c3\u03c4\u03cc\u03c4\u03bf\u03c0\u03bf\u03c5\u03c2) \u03ae \u03c4\u03bf \u03c0\u03b5\u03b4\u03af\u03bf \u038c\u03bd\u03bf\u03bc\u03b1 (\u03b3\u03b9\u03b1 \u03cc\u03bb\u03b1 \u03c4\u03b1 \u03c5\u03c0\u03cc\u03bb\u03bf\u03b9\u03c0\u03b1) \u03c0\u03b1\u03c1\u03b1\u03c0\u03ac\u03bd\u03c9 \u03bc\u03b5 \u03ad\u03bd\u03b1\u03bd \u03c5\u03c0\u03bf\u03b4\u03bf\u03bc\u03bf\u03cd\u03bc\u03b5\u03bd\u03bf \u03bf\u03bd\u03bf\u03bc\u03b1\u03c3\u03c4\u03b9\u03ba\u03cc \u03c4\u03b5\u03bb\u03b5\u03af\u03c9\u03bd .i2p, \u03cc\u03c0\u03c9\u03c2 mynewserver.i2p.";
    t[1838] = "Standby";
    t[1839] = "\u0395\u03bd \u03c0\u03c1\u03bf\u03b5\u03c4\u03bf\u03b9\u03bc\u03b1\u03c3\u03af\u03b1";
    t[1840] = "Set password required to access this service";
    t[1841] = "\u039f\u03c1\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf\u03bd \u03ba\u03c9\u03b4\u03b9\u03ba\u03cc \u03c0\u03bf\u03c5 \u03b1\u03c0\u03b1\u03b9\u03c4\u03b5\u03af\u03c4\u03b1\u03b9 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c0\u03c1\u03bf\u03c3\u03c7\u03c9\u03c1\u03ae\u03c3\u03b5\u03c4\u03b5 \u03c3\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7\u03bd \u03c5\u03c0\u03b7\u03c1\u03b5\u03c3\u03af\u03b1";
    t[1842] = "Hostname or IP address of the target server";
    t[1843] = "\u038c\u03bd\u03bf\u03bc\u03b1 \u03b4\u03b9\u03b5\u03c5\u03b8\u03cd\u03bd\u03c3\u03b7\u03c2 \u03ae IP \u03b4\u03b9\u03b5\u03cd\u03b8\u03c5\u03bd\u03c3\u03b7 \u03c4\u03bf\u03c5 \u03c3\u03c4\u03cc\u03c7\u03bf\u03c5 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae";
    t[1846] = "Description of tunnel to be displayed on Tunnel Manager home page";
    t[1847] = "\u03a0\u03b5\u03c1\u03b9\u03b3\u03c1\u03b1\u03c6\u03ae \u03c4\u03bf\u03c5 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 \u03c0\u03bf\u03c5 \u03b8\u03b1 \u03b5\u03bc\u03c6\u03b1\u03bd\u03b9\u03c3\u03c4\u03b5\u03af \u03c3\u03c4\u03b7\u03bd \u03b1\u03c1\u03c7\u03b9\u03ba\u03ae \u03c3\u03b5\u03bb\u03af\u03b4\u03b1 \u03c4\u03bf\u03c5 \u0394\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ae \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[1854] = "Stop this Tunnel";
    t[1855] = "\u03a3\u03c4\u03b1\u03bc\u03ac\u03c4\u03b7\u03c3\u03b7 \u03b1\u03c5\u03c4\u03bf\u03cd \u03c4\u03bf\u03c5 \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[1864] = "To conserve resources, close tunnels when not in use";
    t[1865] = "\u0393\u03b9\u03b1 \u03bd\u03b1 \u03b1\u03c0\u03bf\u03c6\u03b5\u03c5\u03c7\u03b8\u03b5\u03af \u03b7 \u03ba\u03b1\u03c4\u03b1\u03bd\u03ac\u03bb\u03c9\u03c3\u03b7 \u03c0\u03cc\u03c1\u03c9\u03bd, \u03ba\u03bb\u03b5\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf\u03c5\u03c2 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5\u03c2 \u03cc\u03c4\u03b1\u03bd \u03b4\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03c3\u03b5 \u03c7\u03c1\u03ae\u03c3\u03b7";
    t[1874] = "Previous";
    t[1875] = "\u03a0\u03c1\u03bf\u03b7\u03b3\u03bf\u03cd\u03bc\u03b5\u03bd\u03bf";
    t[1876] = "Configuration reloaded for all tunnels";
    t[1877] = "\u0397 \u03b4\u03b9\u03b1\u03bc\u03cc\u03c1\u03c6\u03c9\u03c3\u03b7 \u03bc\u03b5\u03c4\u03b1\u03c6\u03cc\u03c1\u03c4\u03c9\u03c3\u03b7 \u03b3\u03b9\u03b1 \u03cc\u03bb\u03bf\u03c5\u03c2 \u03c4\u03bf\u03c5\u03c2 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5\u03c2";
    t[1878] = "Tunnel Filter";
    t[1879] = "\u03a6\u03af\u03bb\u03c4\u03c1\u03bf \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[1880] = "Outproxies";
    t[1881] = "Outproxies";
    t[1884] = "Send individual key to each user.";
    t[1885] = "\u0391\u03c0\u03bf\u03c3\u03c4\u03bf\u03bb\u03ae \u03bc\u03b5\u03bc\u03bf\u03bd\u03c9\u03bc\u03ad\u03bd\u03bf\u03c5 \u03ba\u03bb\u03b5\u03b9\u03b4\u03b9\u03bf\u03cd \u03c3\u03b5 \u03ba\u03ac\u03b8\u03b5 \u03c7\u03c1\u03ae\u03c3\u03c4\u03b7.";
    t[1886] = "Name of tunnel to be displayed on Tunnel Manager home page and the router console sidebar";
    t[1887] = "\u038c\u03bd\u03bf\u03bc\u03b1 \u03c4\u03bf\u03c5 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 \u03c0\u03bf\u03c5 \u03b8\u03b1 \u03b5\u03bc\u03c6\u03b1\u03bd\u03b9\u03c3\u03c4\u03b5\u03af \u03c3\u03c4\u03b7\u03bd \u03b1\u03c1\u03c7\u03b9\u03ba\u03ae \u03c3\u03b5\u03bb\u03af\u03b4\u03b1 \u03c4\u03bf\u03c5 \u0394\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ae \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 \u03ba\u03b1\u03b9 \u03c4\u03b7\u03c2 \u03c0\u03bb\u03b5\u03c5\u03c1\u03b9\u03ba\u03ae\u03c2 \u03c3\u03c4\u03ae\u03bb\u03b7\u03c2 \u03c4\u03b7\u03c2 \u03c3\u03c5\u03bd\u03bf\u03bb\u03b9\u03ba\u03ae\u03c2 \u03b5\u03c0\u03b9\u03c6\u03ac\u03bd\u03b5\u03b9\u03b1\u03c2 \u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1\u03c2 \u03c4\u03bf\u03c5 \u03b4\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ae";
    t[1890] = "Generate QR Code";
    t[1891] = "\u0394\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03ae\u03c3\u03c4\u03b5 QR Code";
    t[1892] = "A customised server tunnel for hosting IRC networks inside I2P.";
    t[1893] = "\u0388\u03bd\u03b1\u03c2 \u03c0\u03c1\u03bf\u03c3\u03b1\u03c1\u03bc\u03bf\u03c3\u03bc\u03ad\u03bd\u03bf\u03c2 \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae \u03b3\u03b9\u03b1 \u03c4\u03b7 \u03c6\u03b9\u03bb\u03bf\u03be\u03b5\u03bd\u03af\u03b1 IRC \u03b4\u03b9\u03ba\u03c4\u03cd\u03c9\u03bd \u03bc\u03ad\u03c3\u03b1 \u03c3\u03c4\u03bf I2P.";
    t[1894] = "There are several types of tunnels to choose from:";
    t[1895] = "\u03a5\u03c0\u03ac\u03c1\u03c7\u03bf\u03c5\u03bd \u03c0\u03bf\u03bb\u03bb\u03bf\u03af \u03c4\u03cd\u03c0\u03bf\u03b9 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03c9\u03bd \u03c0\u03bf\u03c5 \u03bc\u03c0\u03bf\u03c1\u03b5\u03af\u03c4\u03b5 \u03bd\u03b1 \u03b5\u03c0\u03b9\u03bb\u03ad\u03be\u03b5\u03c4\u03b5:";
    t[1896] = "lower bandwidth and reliability";
    t[1897] = "\u03bc\u03b9\u03ba\u03c1\u03cc\u03c4\u03b5\u03c1\u03b7 \u03c1\u03c5\u03b8\u03bc\u03b9\u03ba\u03cc\u03c4\u03b7\u03c4\u03b1 \u03ba\u03b1\u03b9 \u03b1\u03be\u03b9\u03bf\u03c0\u03b9\u03c3\u03c4\u03af\u03b1";
    t[1904] = "+/- 0-3 hop variance";
    t[1905] = "+/- 0-3 \u03b4\u03b9\u03b1\u03ba\u03cd\u03bc\u03b1\u03bd\u03c3\u03b7 \u03ba\u03bb\u03af\u03c3\u03bc\u03b1\u03c4\u03bf\u03c2";
    t[1906] = "Target";
    t[1907] = "\u03a3\u03c4\u03cc\u03c7\u03bf\u03c2";
    t[1908] = "Global Tunnel Control";
    t[1909] = "\u03a0\u03b1\u03b3\u03ba\u03cc\u03c3\u03bc\u03b9\u03bf\u03c2 \u0394\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ae\u03c2 \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[1920] = "Invalid port";
    t[1921] = "\u039c\u03b7 \u03ad\u03b3\u03ba\u03c5\u03c1\u03bf \u03bb\u03b9\u03bc\u03ac\u03bd\u03b9";
    t[1926] = "These can be anything you want - they are just for ease of identifying the tunnel in the routerconsole.";
    t[1927] = "\u039c\u03c0\u03bf\u03c1\u03bf\u03cd\u03bd \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03bf\u03c4\u03b9\u03b4\u03ae\u03c0\u03bf\u03c4\u03b5 \u03b5\u03c0\u03b9\u03b8\u03c5\u03bc\u03b5\u03af\u03c4\u03b5 - \u03c7\u03c1\u03b7\u03c3\u03b9\u03bc\u03b5\u03cd\u03bf\u03c5\u03bd \u03b1\u03c0\u03bb\u03ce\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03b4\u03b9\u03b5\u03c5\u03ba\u03bf\u03bb\u03cd\u03bd\u03bf\u03c5\u03bd \u03c4\u03b7\u03bd \u03c4\u03b1\u03c5\u03c4\u03bf\u03c0\u03bf\u03af\u03b7\u03c3\u03b7 \u03c4\u03bf\u03c5 \u03c4\u03bf\u03cd\u03bd\u03b5\u03bb \u03c3\u03c4\u03b7\u03bd \u03ba\u03bf\u03bd\u03c3\u03cc\u03bb\u03b1 \u03c4\u03bf\u03c5 \u03b4\u03b9\u03b1\u03c3\u03cd\u03bd\u03b4\u03b5\u03c3\u03b7\u03c2.";
    t[1930] = "This is the default, recommended option";
    t[1931] = "\u0391\u03c5\u03c4\u03ae \u03b5\u03af\u03bd\u03b1\u03b9 \u03b7 \u03c0\u03c1\u03bf\u03b5\u03c0\u03b9\u03bb\u03b5\u03b3\u03bc\u03ad\u03bd\u03b7, \u03c3\u03c5\u03bd\u03b9\u03c3\u03c4\u03ce\u03bc\u03b5\u03bd\u03b7 \u03b5\u03c0\u03b9\u03bb\u03bf\u03b3\u03ae";
    t[1932] = "Websites outside I2P can also be reached if an HTTP proxy within I2P is known.";
    t[1933] = "\u039c\u03c0\u03bf\u03c1\u03b5\u03af\u03c4\u03b5 \u03b5\u03c0\u03af\u03c3\u03b7\u03c2 \u03bd\u03b1 \u03c0\u03c1\u03bf\u03c3\u03c7\u03c9\u03c1\u03ae\u03c3\u03b5\u03c4\u03b5 \u03c3\u03b5 \u03b9\u03c3\u03c4\u03bf\u03c3\u03b5\u03bb\u03af\u03b4\u03b5\u03c2 \u03b5\u03ba\u03c4\u03cc\u03c2 I2P \u03b1\u03bd \u03b3\u03bd\u03c9\u03c1\u03af\u03b6\u03b5\u03c4\u03b5 \u03ad\u03bd\u03b1 HTTP proxy \u03bc\u03ad\u03c3\u03b1 \u03c3\u03c4\u03bf I2P.";
    t[1938] = "standard bandwidth and reliability";
    t[1939] = "\u03c4\u03c5\u03c0\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03b7 \u03c1\u03c5\u03b8\u03bc\u03b9\u03ba\u03cc\u03c4\u03b7\u03c4\u03b1 \u03ba\u03b1\u03b9 \u03b1\u03be\u03b9\u03bf\u03c0\u03b9\u03c3\u03c4\u03af\u03b1";
    t[1940] = "To enable registration verification, edit tunnel and set name (or website name) to a valid host name ending in '.i2p'";
    t[1941] = "\u0393\u03b9\u03b1 \u03bd\u03b1 \u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03ae\u03c3\u03b5\u03c4\u03b5 \u03c4\u03b7\u03bd \u03b5\u03c0\u03b9\u03b2\u03b5\u03b2\u03b1\u03af\u03c9\u03c3\u03b7 \u03b5\u03b3\u03b3\u03c1\u03b1\u03c6\u03ae\u03c2, \u03b5\u03c0\u03b5\u03be\u03b5\u03c1\u03b3\u03b1\u03c3\u03c4\u03b5\u03af\u03c4\u03b5 \u03c4\u03bf\u03bd \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf \u03ba\u03b1\u03b9 \u03c1\u03c5\u03b8\u03bc\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf \u03cc\u03bd\u03bf\u03bc\u03b1 (\u03ae \u03c4\u03bf \u03cc\u03bd\u03bf\u03bc\u03b1 \u03b9\u03c3\u03c4\u03bf\u03c3\u03b5\u03bb\u03af\u03b4\u03b1\u03c2) \u03c3\u03b5 \u03ad\u03bd\u03b1 \u03ad\u03b3\u03ba\u03c5\u03c1\u03bf \u03cc\u03bd\u03bf\u03bc\u03b1 \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae \u03c0\u03bf\u03c5 \u03c4\u03b5\u03bb\u03b5\u03b9\u03ce\u03bd\u03b5\u03b9 \u03bc\u03b5 '.i2p'";
    t[1942] = "high randomization, very low performance";
    t[1943] = "\u03c8\u03b7\u03bb\u03ae \u03c3\u03c5\u03bd\u03c4\u03c5\u03c7\u03b1\u03b9\u03cc\u03c4\u03b7\u03c4\u03b1, \u03c0\u03bf\u03bb\u03cd \u03c7\u03b1\u03bc\u03b7\u03bb\u03ae \u03b1\u03c0\u03cc\u03b4\u03bf\u03c3\u03b7";
    t[1950] = "If the problem persists, verify that you have cookies enabled in your browser.";
    t[1951] = "\u0395\u03ac\u03bd \u03c4\u03bf \u03c0\u03c1\u03cc\u03b2\u03bb\u03b7\u03bc\u03b1 \u03c0\u03b1\u03c1\u03b1\u03bc\u03ad\u03bd\u03b5\u03b9, \u03b5\u03bb\u03ad\u03b3\u03be\u03c4\u03b5 \u03b1\u03bd \u03ad\u03c7\u03b5\u03c4\u03b5 \u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03b1 \u03c4\u03b1 cookies \u03c3\u03c4\u03bf \u03c0\u03c1\u03cc\u03b3\u03c1\u03b1\u03bc\u03bc\u03b1 \u03c0\u03b5\u03c1\u03b9\u03ae\u03b3\u03b7\u03c3\u03b7\u03c2 \u03c3\u03b1\u03c2.";
    t[1954] = "When enabled, the user agent of your web browser or http client will not be spoofed, potentially reducing your anonymity";
