    t[2203] = "\u039c\u03cc\u03bd\u03b9\u03bc\u03b7 \u03b9\u03b4\u03b9\u03c9\u03c4\u03b9\u03ba\u03ae \u03ba\u03bb\u03b5\u03b9\u03b4\u03b9\u03ac";
