    t[2275] = "\u0394\u03bf\u03ba\u03b9\u03bc\u03ae HTTPS \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae, \u03c0\u03b1\u03c1\u03b1\u03ba\u03ac\u03bc\u03bd\u03bf\u03bd\u03c4\u03b1\u03c2 \u03c4\u03bf I2P";
    t[2280] = "Authentication for changing destination";
    t[2281] = "\u0391\u03c5\u03b8\u03b5\u03bd\u03c4\u03b9\u03ba\u03bf\u03c0\u03bf\u03af\u03b7\u03c3\u03b7 \u03b3\u03b9\u03b1 \u03c4\u03b7\u03bd \u03b1\u03bb\u03bb\u03b1\u03b3\u03ae \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03bf\u03cd";
