    t[2298] = "Client Tunnel";
    t[2299] = "\u0394\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2 \u03a0\u03b5\u03bb\u03ac\u03c4\u03b7";
    t[2308] = "Maximum number of web page requests per day for a unique client before access to the server is blocked";
    t[2309] = "\u039c\u03ad\u03b3\u03b9\u03c3\u03c4\u03bf\u03c2 \u03b1\u03c1\u03b9\u03b8\u03bc\u03cc\u03c2 \u03b1\u03b9\u03c4\u03b7\u03bc\u03ac\u03c4\u03c9\u03bd web \u03c3\u03b5\u03bb\u03af\u03b4\u03b1\u03c2 \u03b1\u03bd\u03ac \u03b7\u03bc\u03ad\u03c1\u03b1 \u03b3\u03b9\u03b1 \u03ad\u03bd\u03b1 \u03bc\u03bf\u03bd\u03b1\u03b4\u03b9\u03ba\u03cc \u03c0\u03b5\u03bb\u03ac\u03c4\u03b7 \u03c0\u03c1\u03b9\u03bd \u03c4\u03bf\u03c4\u03b5 \u03b1\u03c0\u03bf\u03ba\u03bb\u03b5\u03af\u03c3\u03b5\u03b9 \u03b7 \u03c0\u03c1\u03cc\u03c3\u03b2\u03b1\u03c3\u03b7 \u03c3\u03c4\u03bf\u03bd \u03b4\u03b9\u03b1\u03ba\u03bf\u03bc\u03b9\u03c3\u03c4\u03ae";
    t[2320] = "This will add an alias {0} for {1}, using the same destination";
    t[2321] = "\u0391\u03c5\u03c4\u03cc \u03b8\u03b1 \u03c0\u03c1\u03bf\u03c3\u03b8\u03ad\u03c3\u03b5\u03b9 \u03ad\u03bd\u03b1 \u03b5\u03bd\u03b1\u03bb\u03bb\u03b1\u03ba\u03c4\u03b9\u03ba\u03cc \u03cc\u03bd\u03bf\u03bc\u03b1 {0} \u03b3\u03b9\u03b1 {1}, \u03c7\u03c1\u03b7\u03c3\u03b9\u03bc\u03bf\u03c0\u03bf\u03b9\u03ce\u03bd\u03c4\u03b1\u03c2 \u03c4\u03bf\u03bd \u03af\u03b4\u03b9\u03bf \u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03cc";
    t[2324] = "Configuration of signature type is only possible when the tunnel is first created. To change, you must create a new tunnel.";
    t[2325] = "\u0397 \u03b4\u03b9\u03b1\u03bc\u03cc\u03c1\u03c6\u03c9\u03c3\u03b7 \u03c4\u03cd\u03c0\u03bf\u03c5 \u03c5\u03c0\u03bf\u03b3\u03c1\u03b1\u03c6\u03ae\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b4\u03c5\u03bd\u03b1\u03c4\u03ae \u03bc\u03cc\u03bd\u03bf \u03cc\u03c4\u03b1\u03bd \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03b5\u03af\u03c4\u03b1\u03b9 \u03b3\u03b9\u03b1 \u03c0\u03c1\u03ce\u03c4\u03b7 \u03c6\u03bf\u03c1\u03ac \u03bf \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf\u03c2. \u0393\u03b9\u03b1 \u03bd\u03b1 \u03b1\u03bb\u03bb\u03ac\u03be\u03b5\u03c4\u03b5, \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03ae\u03c3\u03b5\u03c4\u03b5 \u03ad\u03bd\u03b1\u03bd \u03bd\u03ad\u03bf \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf.";
    t[2330] = "Via SSL?";
    t[2331] = "\u039c\u03ad\u03c3\u03c9 SSL?";
    t[2336] = "Per Client";
    t[2337] = "\u0391\u03bd\u03ac \u03a0\u03b5\u03bb\u03ac\u03c4\u03b7";
    t[2338] = "Return to Tunnel Manager Index";
    t[2339] = "\u0395\u03c0\u03b9\u03c3\u03c4\u03c1\u03bf\u03c6\u03ae \u03c3\u03c4\u03bf\u03bd \u0395\u03c5\u03c1\u03b5\u03c4\u03ae\u03c1\u03b9\u03bf \u0394\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ae \u0394\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[2340] = "Because you chose to automatically start the tunnel when the router starts, you don't have to do anything further.";
    t[2341] = "\u0395\u03c0\u03b5\u03b9\u03b4\u03ae \u03b5\u03c0\u03b9\u03bb\u03ad\u03be\u03b1\u03c4\u03b5 \u03bd\u03b1 \u03be\u03b5\u03ba\u03b9\u03bd\u03ac\u03c4\u03b5 \u03b1\u03c5\u03c4\u03cc\u03bc\u03b1\u03c4\u03b1 \u03c4\u03bf\u03bd \u03b4\u03b9\u03ac\u03b4\u03c1\u03bf\u03bc\u03bf \u03cc\u03c4\u03b1\u03bd \u03be\u03b5\u03ba\u03b9\u03bd\u03ac \u03bf \u03b4\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ae\u03c2, \u03b4\u03b5\u03bd \u03c7\u03c1\u03b5\u03b9\u03ac\u03b6\u03b5\u03c4\u03b1\u03b9 \u03bd\u03b1 \u03ba\u03ac\u03bd\u03b5\u03c4\u03b5 \u03ba\u03ac\u03c4\u03b9 \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03bf.";
    t[2358] = "Help with defining tunnel filters";
    t[2359] = "\u0392\u03bf\u03ae\u03b8\u03b5\u03b9\u03b1 \u03b3\u03b9\u03b1 \u03c4\u03b7\u03bd \u03bf\u03c1\u03b9\u03c3\u03bc\u03cc \u03c4\u03c9\u03bd \u03c6\u03af\u03bb\u03c4\u03c1\u03c9\u03bd \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5";
    t[2366] = "Retain tunnel identity (destination) when tunnels reopen";
    t[2367] = "\u0394\u03b9\u03b1\u03c4\u03ae\u03c1\u03b7\u03c3\u03b7 \u03c4\u03b7\u03c2 \u03c4\u03b1\u03c5\u03c4\u03cc\u03c4\u03b7\u03c4\u03b1\u03c2 \u03c4\u03bf\u03c5 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03c5 (\u03c0\u03c1\u03bf\u03bf\u03c1\u03b9\u03c3\u03bc\u03cc\u03c2) \u03cc\u03c4\u03b1\u03bd \u03be\u03b1\u03bd\u03b1\u03b1\u03bd\u03bf\u03af\u03b3\u03bf\u03c5\u03bd \u03bf\u03b9 \u03b4\u03b9\u03b1\u03b4\u03c1\u03cc\u03bc\u03bf\u03b9";
    t[2368] = "If the maximum number of post requests per allocated period is exceeded, enforce a global access ban for this number of minutes";
    t[2369] = "\u0391\u03bd \u03c5\u03c0\u03b5\u03c1\u03b2\u03b1\u03af\u03bd\u03b5\u03c4\u03b1\u03b9 \u03bf \u03bc\u03ad\u03b3\u03b9\u03c3\u03c4\u03bf\u03c2 \u03b1\u03c1\u03b9\u03b8\u03bc\u03cc\u03c2 \u03b1\u03b9\u03c4\u03b7\u03bc\u03ac\u03c4\u03c9\u03bd post \u03b1\u03bd\u03ac \u03b4\u03b9\u03b1\u03b8\u03ad\u03c3\u03b9\u03bc\u03b7 \u03c0\u03b5\u03c1\u03af\u03bf\u03b4\u03bf, \u03b5\u03c6\u03b1\u03c1\u03bc\u03cc\u03c3\u03c4\u03b5 \u03bc\u03b9\u03b1 \u03c0\u03b1\u03b3\u03ba\u03cc\u03c3\u03bc\u03b9\u03b1 \u03b1\u03c0\u03bf\u03ba\u03bb\u03bf\u03c4\u03b9\u03c3\u03bc\u03cc \u03c0\u03c1\u03cc\u03c3\u03b2\u03b1\u03c3\u03b7\u03c2 \u03b3\u03b9\u03b1 \u03b1\u03c5\u03c4\u03cc \u03c4\u03bf\u03bd \u03b1\u03c1\u03b9\u03b8\u03bc\u03cc \u03bb\u03b5\u03c0\u03c4\u03ce\u03bd";
    t[2378] = "If you are accessing a service on a remote I2P router, you may wish to connect with SSL to avoid traffic interception. The client application should be also be configured to use SSL.";
